import React from "react";
import "./App.css";
import Form from "./components/Form";

const App = () => {
	return (
		<div className='container'>
			<header>
				<h1>To-Do List</h1>
			</header>
			<main>
				<Form />
			</main>
			<footer>Copyright 2020</footer>
		</div>
	);
};

export default App;
